import React from 'react';
import './home.css';
import image from '../../image/image.png';

import About from '../About/About';
import Contact from '../Contact/Contact';
import Projects from '../Projects/Projects';
import Skills from '../Skills/Skills';
import Education from '../Education/Education';
import Experience from '../Experience/Experience';

const Home = () => {
    return (
        <div className="home-container">
            <div className="image-section">
                <div className="image-wrapper">
                    <img src={image} alt="Vishal Kumar" className="profile-image" />
                    <div className="full-name">Vishal Kumar</div>
                </div>
            </div>

            <div id="about" className="about-wrapper"><About /></div>
            <div id="contact" className="contact-wrapper"><Contact /></div>
            <div id="projects" className="projects-wrapper"><Projects /></div>
            <div id="skills" className="projects-wrapper"><Skills /></div>
            <div id="education" className="projects-wrapper"><Education /></div>
            <div id="experience" className="projects-wrapper"><Experience /></div>
        </div>
    );
};

export default Home;
